import React from "react";

function LoginForm() {
    return (
        <div>
            <h1>Welcome to FilmDEX</h1>
            <button>Login</button>
            <button>Create Account</button>
            <input placeholder="Name"></input>
            <input placeholder="Email"></input>
        </div>
    );
}

export default LoginForm;
